import styled from "styled-components";

const MainContainer = styled.main`
  background: ${(props) => props.theme.text};
  width: 100vw;
  height: 100vh;
  overflow: hidden;
  position: relative;

  h2,h3, h4, h5, h6 {
    font-family: 'karla', sans-serif;
    font-weight: 500;
  }
`;

const container = styled.div`
  padding: 2rem;
`

const Home = () => {
  return <>
    <MainContainer>

    </MainContainer>
   </>;
};

export default Home;
